import React from 'react'
import styles from './Contato.module.css'
import photo from '../img/contato.jpg'

const Contato = () => {
  return (
    <section className={styles.contato}>
      <img src={photo} alt="Máquina de escrever" />
      
      <h2>Contato</h2>
    </section>
  )
}

export default Contato
